      '7-for-all-mankind': {initial: '/95966381/D_Catalogo_Top_Marcas_7FORALLMANKIND', sizes: [[300, 100], [768, 1024]], gpt: 'div-gpt-ad-1441815559158-6', meta: {title: '7 FOR ALL MANKIND', tags: '', description: 'Um denim premium com shapes que se adequam ao corpo de qualquer pessoa, de qualquer parte do mundo. Assim são os jeans da 7 For All Mankind, elaborados com design diferenciado e lavagem artesanal. Queridinhos de celebridades internacionais, como Miranda Kerr, Kristen Stewart, Reese Witherspoon, Sofia Vergara e Sarah Jessica Parker, ganharam status de objetos de desejo e trouxeram de volta o jeans aos holofotes da cena fashion.'}},
      abrand: {initial: '/95966381/D_Catalogo_Top_Marcas_A.BRAND', sizes: [[300, 100], [768, 1024]], gpt: 'div-gpt-ad-1441815559158-7', meta: {title: 'ABRAND', tags: '', description: 'Imagine toda sofisticação de estilo e materiais elevada à máxima potência, assim é a A Brand, nova marca do grupo Animale. Com coleções enxutas e superexclusivas, a marca aposta em uma estética feminina e não abre mão dos detalhes para criar peças únicas.'}},
