      cielle: {initial: '/95966381/D_Catalogo_Top_Marcas_CIELLE', sizes: [768, 1024], gpt: 'div-gpt-ad-1441815559158-45', meta: {title: 'CIELLE', tags: '', description: 'Francesa de nascimento e brasileira de coração, Céline assina peças delicadas e atuais em prata para sua marca Cielle. Com uma proposta cool, as joias da marca transmitem mensagens e emoções, e se transformam em modelo de expressão de quem as usa.'}},
